/**
 * Definition for a binary tree node.
 * struct TreeNode {
 *     int val;
 *     TreeNode *left;
 *     TreeNode *right;
 *     TreeNode() : val(0), left(nullptr), right(nullptr) {}
 *     TreeNode(int x) : val(x), left(nullptr), right(nullptr) {}
 *     TreeNode(int x, TreeNode *left, TreeNode *right) : val(x), left(left), right(right) {}
 * };
 */
class Solution {
public:
    int countNodes(TreeNode* root) {
        if (root == nullptr) {
            return 0;
        }

        int d = depth(root);

        // If the tree has 1 node
        if (d == 0) {
            return 1;
        }

        // Last level nodes are enumerated from 0 to 2^d - 1 (left -> right).
        // Perform binary search to check how many nodes exist.
        int left = 1, right = (1 << d) - 1;
        int pivot;
        while (left <= right) {
            pivot = left + (right - left) / 2;
            if (exists(root, d, pivot)) {
                left = pivot + 1;
            } else {
                right = pivot - 1;
            }
        }

        // The tree contains 2^d - 1 nodes on the first (d - 1) levels
        // and left nodes on the last level.
        return (1 << d) - 1 + left;
    }

private:
    // Compute the depth (height) of a tree.
    int depth(TreeNode* node) {
        int d = 0;
        while (node->left != nullptr) {
            node = node->left;
            ++d;
        }
        return d;
    }

    // Last level nodes are enumerated from 0 to 2^d - 1 (left -> right).
    // Return True if the last level node idx exists. 
    // Binary search with O(d) complexity.
    bool exists(TreeNode* node, int d, int idx) {
        int left = 0, right = (1 << d) - 1;
        int pivot;
        for(int i = 0; i < d; ++i) {
            pivot = left + (right - left) / 2;
            if (idx <= pivot) {
                node = node->left;
                right = pivot;
            } else {
                node = node->right;
                left = pivot + 1;
            }
        }
        return node != nullptr;
    }
};

