        for(int i=0; i<rows; i++){
            for(int j=0; j<cols; j++){
                if(grid[i][j] == 1){
                    perimeter += 4;

                    // If there is a land cell to the left, subtract 2 from the perimeter
                    if(j > 0 && grid[i][j-1] == 1){
                        perimeter -= 2;
                    }

                    // If there is a land cell above, subtract 2 from the perimeter
                    if(i > 0 && grid[i-1][j] == 1){
                        perimeter -= 2;
                    }
                }
            }
        }

        return perimeter;
    }
};

