 *     TreeNode(int x) : val(x), left(nullptr), right(nullptr) {}
 *     TreeNode(int x, TreeNode *left, TreeNode *right) : val(x), left(left), right(right) {}
 * };
 */
class Solution {
public:
    vector<int> findMode(TreeNode* root) {
        vector<int> modes;
        int maxCount = 0, count = 0, currVal = INT_MIN;

        function<void(TreeNode*)> inOrder = [&](TreeNode* node) {
            if (!node) return;
            inOrder(node->left);

            if (node->val != currVal) {
                count = 0;
                currVal = node->val;
            }
            if (++count > maxCount) {
                maxCount = count;
                modes.clear();
            }
            if (count == maxCount) {
                modes.push_back(currVal);
            }

            inOrder(node->right);
        };

        inOrder(root);
        return modes;
    }
};

