        int min_diff = INT_MAX;
        TreeNode* prev = nullptr;
        inorder(root, prev, min_diff);
        return min_diff;
    }

    void inorder(TreeNode* node, TreeNode*& prev, int& min_diff) {
        if (node == nullptr) {
            return;
        }
        inorder(node->left, prev, min_diff);
        if (prev != nullptr) {
            min_diff = min(min_diff, node->val - prev->val);
