 * };
 */
class Solution {
public:
    int findTilt(TreeNode* root) {
        int tilt = 0;
        postOrder(root, tilt);
        return tilt;
    }

private:
    int postOrder(TreeNode* node, int& tilt) {
        if (!node) {
            return 0;
        }

        int left = postOrder(node->left, tilt);
        int right = postOrder(node->right, tilt);

        tilt += abs(left - right);

        return left + right + node->val;
    }
};

