class Solution {
public:
    int findSecondMinimumValue(TreeNode* root) {
        if (!root) return -1;
        int ans = -1;
        int rootvalue = root->val;
        queue<TreeNode*> q;
        q.push(root);
        while (!q.empty()) {
            TreeNode* node = q.front(); q.pop();
            if (!node) continue;
            if (node->val > rootvalue) {
                if (ans == -1) ans = node->val;
                else ans = min(ans, node->val);
            }
            q.push(node->left);
            q.push(node->right);
        }
        return ans;
    }
};

