        unordered_map<int, vector<int>> mp;
        for (int i = 0; i < nums.size(); ++i) {
            if (mp[nums[i]].empty()) {
                mp[nums[i]].resize(3, 0);
                mp[nums[i]][0] = 1;
                mp[nums[i]][1] = mp[nums[i]][2] = i;
            } else {
                ++mp[nums[i]][0];
                mp[nums[i]][2] = i;
            }
        }
        int degree = INT_MIN, res = INT_MAX;
        for (auto &kvp : mp) {
            if (kvp.second[0] > degree) {
                degree = kvp.second[0];
                res = kvp.second[2] - kvp.second[1] + 1;
            } else if (kvp.second[0] == degree) {
                res = min(res, kvp.second[2] - kvp.second[1] + 1);
            }
        }
        return res;
    }
};

