        }
        int target = sum / 3;
        int n = arr.size(), i = 0, cur = 0;
        while (i < n) {
            cur += arr[i];
            if (cur == target) {
                break;
            }
            ++i;
        }
        if (cur != target) {
            return false;
        }
        int j = i + 1;
        cur = 0;
        while (j + 1 < n) {
            cur += arr[j];
            if (cur == target) {
                break;
            }
            ++j;
        }
        if (cur != target) {
            return false;
        }
        return true;
    }
};

