            chars_count[c - 'a']++;
        }

        for (string& word : words) {
            vector<int> word_count(26, 0);
            bool is_good = true;

            // Count the occurrence of each character in word
            for (char c : word) {
                word_count[c - 'a']++;

                // If the character occurs more times in word than in chars, it's not a good string
                if (word_count[c - 'a'] > chars_count[c - 'a']) {
                    is_good = false;
                    break;
                }
