        int month = stoi(date.substr(5, 2));
        int day = stoi(date.substr(8, 2));
        if (month > 2 && year % 4 == 0 && (year % 100 != 0 || year % 400 == 0)) day++;
        while (--month > 0) {
            day += daysInMonth[month];
        }
        return day;
    }
};

