    int distanceBetweenBusStops(vector<int>& distance, int start, int destination) {
        if(start > destination) {
            swap(start, destination);
        }
        int total = 0;
        int direct = 0;
        for(int i = 0; i < distance.size(); i++) {
            if(start <= i && i < destination) {
                direct += distance[i];
            }
            total += distance[i];
        }
        return min(direct, total - direct);
    }
};

