    string reformat(string s) {
        string letters = "", digits = "";
        for (char c : s) {
            if (isdigit(c)) digits += c;
            else letters += c;
        }
        if (abs((int)letters.size() - (int)digits.size()) > 1) return "";
        bool digitFirst = digits.size() > letters.size();
        string res = "";
        for (int i = 0; i < s.size(); i++) {
            if (digitFirst) {
                if (i < digits.size()) res += digits[i];
                if (i < letters.size()) res += letters[i];
            } else {
                if (i < letters.size()) res += letters[i];
                if (i < digits.size()) res += digits[i];
            }
        }
        return res;
    }
};

