        int sum = 0;
        for(int i = 0; i < n; i++) {
            sum += mat[i][i]; // primary diagonal
            sum += mat[i][n-i-1]; // secondary diagonal
        }
        // If n is odd, subtract the center element as it is counted twice
        if(n % 2 == 1) {
            sum -= mat[n/2][n/2];
        }
        return sum;
    }
};

class Solution {
