        count[rounds[0]]++;
        for (int i = 1; i < size; i++) {
            int start = rounds[i - 1], end = rounds[i];
            if (start < end) {
                for (int j = start + 1; j <= end; j++) {
                    count[j]++;
                }
            } else {
                for (int j = start + 1; j <= n; j++) {
                    count[j]++;
                }
                for (int j = 1; j <= end; j++) {
                    count[j]++;
                }
            }
        }
        int maxCount = *max_element(count.begin(), count.end());
        vector<int> result;
        for (int i = 1; i <= n; i++) {
            if (count[i] == maxCount) {
                result.push_back(i);
            }
        }
        return result;
    }
};

