class Solution {
public:
    string reorderSpaces(string text) {
        int spaceCount = 0;
        for (char c : text) {
            if (c == ' ') {
                spaceCount++;
            }
        }

        vector<string> words;
        stringstream ss(text);
        string word;
        while (ss >> word) {
            words.push_back(word);
        }

        int gap = words.size() == 1 ? 0 : spaceCount / (words.size() - 1);
        int trailingSpaces = words.size() == 1 ? spaceCount : spaceCount % (words.size() - 1);

        string result;
        for (int i = 0; i < words.size(); i++) {
            result += words[i];
            if (i < words.size() - 1) {
                result += string(gap, ' ');
            }
        }
        result += string(trailingSpaces, ' ');

        return result;
    }
};

