        string cleaned;
        for (char c : number) {
            if (isdigit(c)) cleaned.push_back(c);
        }

        string result;
        int n = cleaned.size();
        int i = 0;
        while (n > 4) {
            result += cleaned.substr(i, 3) + "-";
            i += 3;
            n -= 3;
        }

        if (n == 4) {
            result += cleaned.substr(i, 2) + "-" + cleaned.substr(i + 2, 2);
        } else {
            result += cleaned.substr(i, n);
        }

        return result;
    }
