        int maxUnits = 0;
        for (auto& boxType : boxTypes) {
            int boxCount = min(boxType[0], truckSize);
            maxUnits += boxCount * boxType[1];
            truckSize -= boxCount;
            if (truckSize == 0) {
                break;
            }
        }
        return maxUnits;
    }
};

