class Solution {
public:
    string longestNiceSubstring(string s) {
        int n = s.size();
        string res = "";
        for(int i = 0; i < n; i++) {
            for(int j = i + 1; j <= n; j++) {
                string sub = s.substr(i, j - i);
                set<char> st(sub.begin(), sub.end());
                bool nice = true;
                for(char c : st) {
                    if(st.find(tolower(c)) == st.end() || st.find(toupper(c)) == st.end()) {
                        nice = false;
                        break;
                    }
                }
                if(nice && sub.size() > res.size()) {
                    res = sub;
                }
            }
        }
        return res;
    }
};

