class Solution {
public:
    int countValidWords(string sentence) {
        int count = 0;
        stringstream ss(sentence);
        string word;
        while (ss >> word) {
            int hyphen = 0, punctuation = 0, digit = 0;
            for (int i = 0; i < word.size(); ++i) {
                if (word[i] == '-') {
                    ++hyphen;
                    if (i == 0 || i == word.size() - 1 || word[i - 1] == '-' || word[i + 1] == '-')
                        hyphen = 2;
                } else if (word[i] == '!' || word[i] == '.' || word[i] == ',') {
                    ++punctuation;
                    if (i != word.size() - 1)
                        punctuation = 2;
                } else if (isdigit(word[i])) {
                    ++digit;
                }
            }
