        int n = nums.size();
        vector<int> left(n), right(n);
        left[0] = nums[0];
        right[n-1] = nums[n-1];
        for(int i=1; i<n; i++) {
            left[i] = max(left[i-1], nums[i]);
            right[n-i-1] = max(right[n-i], nums[n-i-1]);
        }
        int count = 0;
        for(int i=1; i<n-1; i++) {
            if(nums[i] > nums[i-1] && nums[i] > nums[i+1] && nums[i] > left[i-1] && nums[i] > right[i+1]) {
                count++;
                if(i<n-2 && nums[i] == nums[i+1]) {
                    i++;
                }
            }
            else if(nums[i] < nums[i-1] && nums[i] < nums[i+1] && nums[i] < left[i-1] && nums[i] < right[i+1]) {
                count++;
                if(i<n-2 && nums[i] == nums[i+1]) {
                    i++;
                }
            }
        }
        return count;
    }
};

