class Solution {
public:
    int convertTime(string current, string correct) {
        int currentHour = stoi(current.substr(0, 2));
        int currentMinute = stoi(current.substr(3, 2));
        int correctHour = stoi(correct.substr(0, 2));
        int correctMinute = stoi(correct.substr(3, 2));

        int totalCurrentMinutes = currentHour * 60 + currentMinute;
        int totalCorrectMinutes = correctHour * 60 + correctMinute;

        int diff = totalCorrectMinutes - totalCurrentMinutes;

        int operations = 0;
        operations += diff / 60; // 60 minutes operation
        diff %= 60;
        operations += diff / 15; // 15 minutes operation
        diff %= 15;
        operations += diff / 5; // 5 minutes operation
        diff %= 5;
        operations += diff; // 1 minute operation

        return operations;
    }
};

