            total += amount[i];
        }
        return (total + 1) / 2;
    }
};

/**
 * Definition for a binary tree node.
 * struct TreeNode {
 *     int val;
 *     TreeNode *left;
 *     TreeNode *right;
 *     TreeNode() : val(0), left(nullptr), right(nullptr) {}
 *     TreeNode(int x) : val(x), left(nullptr), right(nullptr) {}
 *     TreeNode(int x, TreeNode *left, TreeNode *right) : val(x), left(left), right(right) {}
 * };
 */
class Solution {
public:
    bool evaluateTree(TreeNode* root) {
        if(root->val == 0) return false;
        if(root->val == 1) return true;
        bool left = evaluateTree(root->left);
        bool right = evaluateTree(root->right);
        if(root->val == 2) return left || right;
        if(root->val == 3) return left && right;
        return false;
    }
};

class Solution {
public:
    vector<int> numberOfPairs(vector<int>& nums) {
        vector<int> count(101, 0);
        for (int num : nums) {
            count[num]++;
        }
        int pairs = 0, leftovers = 0;
        for (int c : count) {
            pairs += c / 2;
            leftovers += c % 2;
        }
        return {pairs, leftovers};
    }
};

class Solution {
public:
    char repeatedCharacter(string s) {
        vector<int> count(26, -1);
        int res = INT_MAX;
        char ans;
        for(int i = 0; i < s.size(); i++) {
            if(count[s[i] - 'a'] != -1) {
                if(i < res) {
                    res = i;
                    ans = s[i];
                }
            } else {
                count[s[i] - 'a'] = i;
            }
        }
        return ans;
    }
};

class Solution {
public:
    string bestHand(vector<int>& ranks, vector<char>& suits) {
        unordered_map<int, int> rankCount;
        unordered_map<char, int> suitCount;
        for (int i = 0; i < 5; ++i) {
            ++rankCount[ranks[i]];
            ++suitCount[suits[i]];
        }
        bool isFlush = false;
        bool isThreeOfAKind = false;
        bool isPair = false;
        for (auto& count : suitCount) {
            if (count.second == 5) {
                isFlush = true;
                break;
            }
        }
        for (auto& count : rankCount) {
            if (count.second == 3) {
                isThreeOfAKind = true;
            } else if (count.second == 2) {
                isPair = true;
            }
        }
        if (isFlush) {
            return "Flush";
        } else if (isThreeOfAKind) {
            return "Three of a Kind";
        } else if (isPair) {
            return "Pair";
        } else {
            return "High Card";
        }
    }
};

