class Solution {
public:
    int arithmeticTriplets(vector<int>& nums, int diff) {
        int n = nums.size();
        unordered_map<int, int> count;
        int res = 0;
        for (int i = 0; i < n; ++i) {
            for (int j = 0; j < i; ++j) {
                int need = 2 * nums[j] - nums[i];
                if (count.count(need)) {
                    res += count[need];
                }
            }
            ++count[nums[i]];
        }
        return res;
    }
};

class Solution {
