class Solution {
public:
    vector<vector<int>> largestLocal(vector<vector<int>>& grid) {
        int n = grid.size();
        vector<vector<int>> maxLocal(n - 2, vector<int>(n - 2, 0));
        for (int i = 1; i < n - 1; i++) {
            for (int j = 1; j < n - 1; j++) {
                int maxVal = grid[i - 1][j - 1];
                for (int dx = -1; dx <= 1; dx++) {
                    for (int dy = -1; dy <= 1; dy++) {
                        maxVal = max(maxVal, grid[i + dx][j + dy]);
                    }
                }
                maxLocal[i - 1][j - 1] = maxVal;
            }
        }
        return maxLocal;
    }
};

class Solution {
public:
    int minNumberOfHours(int initialEnergy, int initialExperience, vector<int>& energy, vector<int>& experience) {
        int n = energy.size();
        vector<pair<int, int>> opponents(n);
        for (int i = 0; i < n; ++i) {
            opponents[i] = {energy[i], experience[i]};
        }
        sort(opponents.begin(), opponents.end());
        vector<vector<int>> dp(n + 1, vector<int>(101, INT_MAX));
        dp[0][initialExperience] = 0;
        for (int i = 0; i < n; ++i) {
            for (int j = 0; j <= 100; ++j) {
                if (dp[i][j] == INT_MAX) continue;
                for (int k = max(j, opponents[i].second); k <= 100; ++k) {
                    int energyNeeded = max(0, opponents[i].first - initialEnergy - dp[i][j]);
                    dp[i + 1][k] = min(dp[i + 1][k], dp[i][j] + energyNeeded);
                }
            }
        }
        int minHours = INT_MAX;
        for (int i = 0; i <= 100; ++i) {
            minHours = min(minHours, dp[n][i]);
        }
        return minHours;
    }
};

class Solution {
public:
    int minimumRecolors(string blocks, int k) {
        int n = blocks.size();
        vector<int> prefix(n+1, 0);
        for(int i = 1; i <= n; i++) {
            prefix[i] = prefix[i-1] + (blocks[i-1] == 'B' ? 1 : 0);
        }
        int ans = INT_MAX;
        for(int i = 0; i <= n-k; i++) {
            ans = min(ans, k - (prefix[i+k] - prefix[i]));
        }
        return ans;
    }
};

class Solution {
public:
    vector<int> answerQueries(vector<int>& nums, vector<int>& queries) {
        sort(nums.begin(), nums.end());
        vector<int> prefixSum(nums.size() + 1, 0);
        for (int i = 0; i < nums.size(); ++i) {
            prefixSum[i + 1] = prefixSum[i] + nums[i];
        }
        vector<int> answer(queries.size());
        for (int i = 0; i < queries.size(); ++i) {
            int left = 0, right = nums.size();
            while (left < right) {
                int mid = left + (right - left + 1) / 2;
                if (prefixSum[mid] <= queries[i]) {
                    left = mid;
                } else {
                    right = mid - 1;
                }
            }
            answer[i] = left;
        }
        return answer;
    }
};

class Solution {
public:
    bool checkDistances(string s, vector<int>& distance) {
        vector<int> last(26, -1);
        for (int i = 0; i < s.size(); ++i) {
            int idx = s[i] - 'a';
            if (last[idx] != -1 && i - last[idx] - 1 != distance[idx]) {
                return false;
            }
            last[idx] = i;
        }
        return true;
    }
};

class Solution {
public:
    bool findSubarrays(vector<int>& nums) {
        unordered_map<int, int> sumMap;
        for (int i = 0; i < nums.size() - 1; ++i) {
            int sum = nums[i] + nums[i + 1];
            if (sumMap.count(sum)) {
                return true;
            }
            sumMap[sum] = i;
        }
        return false;
    }
};

class Solution {
public:
    int mostFrequentEven(vector<int>& nums) {
        unordered_map<int, int> count;
        for (int num : nums) {
            if (num % 2 == 0) {
                count[num]++;
            }
        }
        int maxCount = 0;
        int res = -1;
        for (auto& [num, cnt] : count) {
            if (cnt > maxCount || (cnt == maxCount && num < res)) {
                maxCount = cnt;
                res = num;
            }
        }
        return res;
    }
};

