class Solution {
public:
    int countDaysTogether(string arriveAlice, string leaveAlice, string arriveBob, string leaveBob) {
        vector<int> daysInMonth = {0, 31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31};
        auto convert = [&](string date) {
            int month = stoi(date.substr(0, 2));
            int day = stoi(date.substr(3, 2));
            for (int i = 1; i < month; ++i) {
                day += daysInMonth[i];
            }
            return day;
        };
        int arriveAliceDay = convert(arriveAlice);
        int leaveAliceDay = convert(leaveAlice);
        int arriveBobDay = convert(arriveBob);
        int leaveBobDay = convert(leaveBob);
        int start = max(arriveAliceDay, arriveBobDay);
        int end = min(leaveAliceDay, leaveBobDay);
        return max(0, end - start + 1);
    }
};

