};

class Solution {
public:
    int hardestWorker(int n, vector<vector<int>>& logs) {
        vector<int> workTime(n, 0);
        int prevTime = 0;
        for (auto& log : logs) {
            workTime[log[0]] += log[1] - prevTime;
            prevTime = log[1];
        }
        int maxTime = 0, hardestWorkerId = 0;
        for (int i = 0; i < n; ++i) {
            if (workTime[i] > maxTime) {
                maxTime = workTime[i];
                hardestWorkerId = i;
            }
        }
        return hardestWorkerId;
    }
};

class Solution {
