class Solution {
public:
    bool equalFrequency(string word) {
        vector<int> freq(26, 0);
        for (char c : word) {
            freq[c - 'a']++;
        }
        sort(freq.begin(), freq.end());
        int i = 0;
        while (freq[i] == 0) {
            i++;
        }
        if (freq[i] == freq[25]) {
            return true;
        }
        if (freq[i] == 1 && freq[i + 1] == freq[25]) {
            return true;
        }
        if (freq[i] == freq[24] && freq[25] - freq[24] == 1) {
            return true;
        }
        return false;
    }
};

class Solution {
public:
    bool haveConflict(vector<string>& event1, vector<string>& event2) {
        int start1 = stoi(event1[0].substr(0, 2)) * 60 + stoi(event1[0].substr(3, 2));
        int end1 = stoi(event1[1].substr(0, 2)) * 60 + stoi(event1[1].substr(3, 2));
        int start2 = stoi(event2[0].substr(0, 2)) * 60 + stoi(event2[0].substr(3, 2));
        int end2 = stoi(event2[1].substr(0, 2)) * 60 + stoi(event2[1].substr(3, 2));

        return !(end1 <= start2 || end2 <= start1);
    }
};

class Solution {
public:
    int averageValue(vector<int>& nums) {
        int sum = 0;
        int count = 0;
        for(int i = 0; i < nums.size(); i++) {
            if(nums[i] % 2 == 0 && nums[i] % 3 == 0) {
                sum += nums[i];
                count++;
            }
        }
        if(count == 0) {
            return 0;
        }
        return sum / count;
    }
};

class Solution {
public:
    string oddString(vector<string>& words) {
        unordered_map<string, int> count;
        for (string& word : words) {
            string diff;
            for (int i = 1; i < word.size(); ++i) {
                diff += to_string((word[i] - word[i - 1] + 26) % 26) + ",";
            }
            ++count[diff];
        }
        for (string& word : words) {
            string diff;
            for (int i = 1; i < word.size(); ++i) {
                diff += to_string((word[i] - word[i - 1] + 26) % 26) + ",";
            }
            if (count[diff] == 1) {
                return word;
            }
        }
        return "";
    }
};

class Solution {
public:
    vector<int> applyOperations(vector<int>& nums) {
        int n = nums.size();
        for(int i = 0; i < n - 1; i++) {
            if(nums[i] == nums[i + 1]) {
                nums[i] *= 2;
                nums[i + 1] = 0;
            }
        }
        int zeroCount = count(nums.begin(), nums.end(), 0);
        vector<int> result(n - zeroCount, 0);
        copy_if(nums.begin(), nums.end(), back_inserter(result), [](int x){return x != 0;});
        result.insert(result.end(), zeroCount, 0);
        return result;
    }
};

