class Solution {
public:
    bool isCircularSentence(string sentence) {
        stringstream ss(sentence);
        string word, prev;
        while (ss >> word) {
            if (!prev.empty() && prev.back() != word.front()) {
                return false;
            }
            prev = word;
        }
        return sentence.front() == word.back();
    }
};

class Solution {
public:
    int deleteGreatestValue(vector<vector<int>>& grid) {
        int m = grid.size();
        int n = grid[0].size();
        int ans = 0;
        priority_queue<pair<int, pair<int, int>>> pq;
        for(int i = 0; i < m; i++) {
            int max_val = *max_element(grid[i].begin(), grid[i].end());
            pq.push({max_val, {i, max_val}});
        }
        while(!pq.empty()) {
            pair<int, pair<int, int>> p = pq.top();
            pq.pop();
            ans += p.first;
            int row = p.second.first;
            int val = p.second.second;
            auto it = find(grid[row].begin(), grid[row].end(), val);
            if(it != grid[row].end()) {
                grid[row].erase(it);
                if(!grid[row].empty()) {
                    int max_val = *max_element(grid[row].begin(), grid[row].end());
                    pq.push({max_val, {row, max_val}});
                }
            }
        }
        return ans;
    }
};

class Solution {
public:
    int maximumValue(vector<string>& strs) {
        int max_value = 0;
        for (string str : strs) {
            bool is_digit = true;
            for (char c : str) {
                if (!isdigit(c)) {
                    is_digit = false;
                    break;
                }
            }
            if (is_digit) {
                max_value = max(max_value, stoi(str));
            } else {
                max_value = max(max_value, (int)str.size());
            }
        }
        return max_value;
    }
};

class Solution {
public:
    int similarPairs(vector<string>& words) {
        int count = 0;
        for(int i = 0; i < words.size(); i++) {
            for(int j = i+1; j < words.size(); j++) {
                if(isSimilar(words[i], words[j])) {
                    count++;
                }
            }
        }
        return count;
    }

    bool isSimilar(string& s1, string& s2) {
        vector<int> count1(26, 0), count2(26, 0);
        for(char c : s1) {
            count1[c - 'a']++;
        }
        for(char c : s2) {
            count2[c - 'a']++;
        }
        return count1 == count2;
    }
};

class Solution {
public:
    int closetTarget(vector<string>& words, string target, int startIndex) {
        int n = words.size();
        int left = startIndex, right = startIndex;
        int leftSteps = 0, rightSteps = 0;

        while (true) {
            if (words[left] == target) return leftSteps;
            if (words[right] == target) return rightSteps;

            left = (left - 1 + n) % n;
            right = (right + 1) % n;
            leftSteps++;
            rightSteps++;

            if (leftSteps >= n && rightSteps >= n) return -1;
        }
    }
};

class Solution {
public:
    int captureForts(vector<int>& forts) {
        int n = forts.size();
        vector<int> prefix(n, 0), suffix(n, 0);
        int cnt = 0;
        for (int i = 0; i < n; ++i) {
            if (forts[i] == 0) {
                prefix[i] = cnt;
            } else if (forts[i] == 1) {
                cnt = 0;
            }
        }
        cnt = 0;
        for (int i = n - 1; i >= 0; --i) {
            if (forts[i] == 0) {
                suffix[i] = cnt;
            } else if (forts[i] == 1) {
                cnt = 0;
            }
        }
        int maxForts = 0;
        for (int i = 0; i < n; ++i) {
            if (forts[i] == 1) {
                maxForts = max(maxForts, prefix[i] + suffix[i]);
            }
        }
        return maxForts;
    }
};

class Solution {
public:
    int countDigits(int num) {
        int temp = num;
        int count = 0;
        while(temp > 0){
            int digit = temp % 10;
            if(num % digit == 0){
                count++;
            }
            temp /= 10;
        }
        return count;
    }
};

class Solution {
public:
    int maximumCount(vector<int>& nums) {
        int n = nums.size();
        int l = 0, r = n - 1;
        while (l <= r) {
            int mid = l + (r - l) / 2;
            if (nums[mid] < 0)
                l = mid + 1;
            else
                r = mid - 1;
        }
        int pos = n - l;
        int neg = n - pos;
        return max(pos, neg);
    }
};

class Solution {
public:
    string categorizeBox(int length, int width, int height, int mass) {
        long long volume = (long long)length * width * height;
        bool isBulky = length >= 104 || width >= 104 || height >= 104 || volume >= 1e9;
        bool isHeavy = mass >= 100;

        if (isBulky && isHeavy) {
            return "Both";
        } else if (isBulky) {
            return "Bulky";
        } else if (isHeavy) {
            return "Heavy";
        } else {
            return "Neither";
        }
    }
};

class Solution {
public:
    int differenceOfSum(vector<int>& nums) {
        int elementSum = 0, digitSum = 0;
        for (int num : nums) {
            elementSum += num;
            while (num) {
                digitSum += num % 10;
                num /= 10;
            }
        }
        return abs(elementSum - digitSum);
    }
};

class Solution {
public:
    int alternateDigitSum(int n) {
        int sum = 0;
        int sign = 1;
        while (n > 0) {
            int digit = n % 10;
            sum += sign * digit;
            sign *= -1;
            n /= 10;
        }
        return sum;
    }
};

class Solution {
public:
    int getCommon(vector<int>& nums1, vector<int>& nums2) {
        int i = 0, j = 0;
        while(i < nums1.size() && j < nums2.size()){
            if(nums1[i] == nums2[j]){
                return nums1[i];
            }
            else if(nums1[i] < nums2[j]){
                i++;
            }
            else{
                j++;
            }
        }
        return -1;
    }
};

class Solution {
public:
    vector<int> separateDigits(vector<int>& nums) {
        vector<int> result;
        for(int num : nums) {
            vector<int> digits;
            while(num) {
                digits.push_back(num % 10);
                num /= 10;
            }
            reverse(digits.begin(), digits.end());
            result.insert(result.end(), digits.begin(), digits.end());
        }
        return result;
    }
};

class Solution {
public:
    int passThePillow(int n, int time) {
        int direction = 1;
        int current = 1;
        for(int i = 0; i < time; i++) {
            current += direction;
            if(current == n + 1 || current == 0) {
                direction *= -1;
                current += 2 * direction;
            }
        }
        return current;
    }
};

class Solution {
public:
    int splitNum(int num) {
        vector<int> count(10, 0);
        while (num > 0) {
            count[num % 10]++;
            num /= 10;
        }
        int num1 = 0, num2 = 0, tens = 1;
        for (int i = 0; i < 10; ++i) {
            while (count[i]-- > 0) {
                if (num1 <= num2) {
                    num1 += i * tens;
                } else {
                    num2 += i * tens;
                }
                tens *= 10;
            }
        }
        return num1 + num2;
    }
};

class Solution {
public:
    int vowelStrings(vector<string>& words, int left, int right) {
        int count = 0;
        for(int i = left; i <= right; i++) {
            if(isVowel(words[i][0]) && isVowel(words[i][words[i].size()-1])) {
                count++;
            }
        }
        return count;
    }

    bool isVowel(char c) {
        return c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u';
    }
};

