class Solution {
public:
    vector<int> leftRightDifference(vector<int>& nums) {
        int n = nums.size();
        vector<int> leftSum(n, 0), rightSum(n, 0), answer(n, 0);

        // Calculate leftSum
        for(int i = 1; i < n; i++) {
            leftSum[i] = leftSum[i-1] + nums[i-1];
        }

        // Calculate rightSum
        for(int i = n-2; i >= 0; i--) {
            rightSum[i] = rightSum[i+1] + nums[i+1];
        }

        // Calculate answer
        for(int i = 0; i < n; i++) {
            answer[i] = abs(leftSum[i] - rightSum[i]);
        }

        return answer;
    }
};

class Solution {
public:
    int kItemsWithMaximumSum(int numOnes, int numZeros, int numNegOnes, int k) {
        int dp[101][101] = {0};
        for (int i = 0; i <= numOnes; ++i) {
            for (int j = 0; j <= numNegOnes; ++j) {
                for (int k = max(0, i + j - numZeros); k <= i + j; ++k) {
                    if (i > 0) dp[i][j] = max(dp[i][j], (k > 0 ? dp[i - 1][j] + 1 : dp[i - 1][j]));
                    if (j > 0) dp[i][j] = max(dp[i][j], (k > 0 ? dp[i][j - 1] - 1 : dp[i][j - 1]));
                }
            }
        }
        return dp[numOnes][numNegOnes];
    }
};

class Solution {
