class Cancellable {
public:
    Cancellable(std::function<int(std::vector<int>)> fn, std::vector<int> args, int t)
        : fn_(fn), args_(args), t_(t), cancelled_(false) {
        thread_ = std::thread([this]() {
            while (!cancelled_) {
                fn_(args_);
                std::this_thread::sleep_for(std::chrono::milliseconds(t_));
            }
        });
    }

    void cancel() {
        cancelled_ = true;
        if (thread_.joinable()) {
            thread_.join();
        }
    }

private:
    std::function<int(std::vector<int>)> fn_;
    std::vector<int> args_;
    int t_;
    bool cancelled_;
    std::thread thread_;
};

