class Solution {
public:
    int longestAlternatingSubarray(vector<int>& nums, int threshold) {
        int n = nums.size();
        int maxLen = 0;
        for(int i = 0; i < n; i++) {
            if(nums[i] % 2 == 0 && nums[i] <= threshold) {
                int len = 1;
                for(int j = i + 1; j < n; j++) {
                    if(nums[j] <= threshold && nums[j] % 2 != nums[j - 1] % 2) {
                        len++;
                    } else {
                        break;
                    }
                }
                maxLen = max(maxLen, len);
            }
        }
        return maxLen;
    }
};

class Solution {
public:
    int alternatingSubarray(vector<int>& nums) {
        int n = nums.size();
        int maxLen = 1;
        int curLen = 1;
        for(int i = 1; i < n; i++) {
            if((nums[i] - nums[i-1]) * (nums[i-1] - nums[i-2]) < 0) {
                curLen++;
                maxLen = max(maxLen, curLen);
            } else {
                curLen = 2;
            }
        }
        return maxLen > 1 ? maxLen : -1;
    }
};

