class Solution {
public:
    int maxSum(vector<int>& nums) {
        vector<int> maxNums(10, -1);
        vector<int> secondMaxNums(10, -1);

        for (int num : nums) {
            int maxDigit = 0;
            int temp = num;
            while (temp > 0) {
                maxDigit = max(maxDigit, temp % 10);
                temp /= 10;
            }

            if (num > maxNums[maxDigit]) {
                secondMaxNums[maxDigit] = maxNums[maxDigit];
                maxNums[maxDigit] = num;
            } else if (num > secondMaxNums[maxDigit]) {
                secondMaxNums[maxDigit] = num;
            }
        }

        int maxSum = -1;
        for (int i = 0; i < 10; ++i) {
            if (secondMaxNums[i] != -1) {
                maxSum = max(maxSum, maxNums[i] + secondMaxNums[i]);
            }
        }

        return maxSum;
    }
};

