class Solution {
public:
    int countSymmetricIntegers(int low, int high) {
        int count = 0;
        for (int i = low; i <= high; i++) {
            if (i < 10) continue;
            string num = to_string(i);
            if (num.size() % 2 != 0) continue;
            int half = num.size() / 2;
            int sum1 = 0, sum2 = 0;
            for (int j = 0; j < half; j++) {
                sum1 += num[j] - '0';
                sum2 += num[j + half] - '0';
            }
            if (sum1 == sum2) count++;
        }
        return count;
    }
};

