class Solution {
public:
    int minOperations(vector<int>& nums, int k) {
        int n = nums.size();
        vector<int> pos(n+1);
        for(int i = 0; i < n; ++i) {
            pos[nums[i]] = i+1;
        }
        vector<int> dp(n+1, INT_MAX);
        dp[0] = 0;
        for(int i = 1; i <= k; ++i) {
            for(int j = n; j >= pos[i]; --j) {
                dp[j] = min(dp[j], dp[j-pos[i]]+1);
            }
        }
        return dp[n];
    }
};

class Solution {
public:
    int minimumRightShifts(vector<int>& nums) {
        int n = nums.size();
        vector<int> sorted_nums = nums;
        sort(sorted_nums.begin(), sorted_nums.end());
        for (int i = 0; i < n; ++i) {
            if (nums == sorted_nums) {
                return i;
            }
            rotate(nums.rbegin(), nums.rbegin() + 1, nums.rend());
        }
        return -1;
    }
};

class Solution {
public:
    string maximumOddBinaryNumber(string s) {
        int count1 = 0;
        int count0 = 0;
        for (char c : s) {
            if (c == '1') {
                count1++;
            } else {
                count0++;
            }
        }
        string result = "";
        if (count1 > 0) {
            result += '1';
            count1--;
        }
        while (count0--) {
            result += '0';
        }
        while (count1--) {
            result += '1';
        }
        return result;
    }
};

