        int sum = 0;
        for (int i = 0; i < n; i++) {
            unordered_set<int> distinct;
            for (int j = i; j < n; j++) {
                distinct.insert(nums[j]);
                sum += pow(distinct.size(), 2);
            }
        }
        return sum;
    }
};

class Solution {
public:
    vector<int> lastVisitedIntegers(vector<int>& nums) {
        vector<int> seen, ans;
        int k = 0;
        for (int num : nums) {
            if (num == -1) {
                k++;
                if (k <= seen.size()) {
                    ans.push_back(seen[k - 1]);
                } else {
                    ans.push_back(-1);
                }
            } else {
                seen.insert(seen.begin(), num);
                k = 0;
            }
        }
        return ans;
    }
};

class Solution {
public:
    vector<int> findIndices(vector<int>& nums, int indexDifference, int valueDifference) {
        int n = nums.size();
        for(int i = 0; i < n; i++) {
            for(int j = i; j < n; j++) {
                if(abs(i - j) >= indexDifference && abs(nums[i] - nums[j]) >= valueDifference) {
                    return {i, j};
                }
            }
        }
        return {-1, -1};
    }
};

