class Solution {
public:
    int minimumSum(vector<int>& nums) {
        int n = nums.size();
        int minSum = INT_MAX;
        bool found = false;

        for(int j = 1; j < n - 1; ++j) {
            int leftMin = INT_MAX;
            int rightMin = INT_MAX;

            for(int i = 0; i < j; ++i) {
                if(nums[i] < nums[j]) {
                    leftMin = min(leftMin, nums[i]);
                }
            }

            for(int k = j + 1; k < n; ++k) {
                if(nums[k] < nums[j]) {
                    rightMin = min(rightMin, nums[k]);
                }
            }

            if(leftMin != INT_MAX && rightMin != INT_MAX) {
                minSum = min(minSum, leftMin + nums[j] + rightMin);
                found = true;
            }
        }

        return found ? minSum : -1;
    }
};

class Solution {
public:
    int findKOr(vector<int>& nums, int k) {
        int res = 0;
        for (int bit = 0; bit < 31; ++bit) {
            int count = 0;
            for (int num : nums) {
                if (num & (1 << bit)) {
                    ++count;
                }
            }
            if (count >= k) {
                res |= (1 << bit);
            }
        }
        return res;
    }
};

