class Solution {
public:
    int distributeCandies(int n, int limit) {
        vector<vector<int>> dp(n + 1, vector<int>(n + 1, 0));
        dp[0][0] = 1;
        for (int i = 0; i <= n; ++i) {
            for (int j = 0; j <= i; ++j) {
                for (int k = 0; k <= limit && k <= i; ++k) {
                    if (j + k <= i) {
                        dp[i][j + k] = (dp[i][j + k] + dp[i - k][j]) % 1000000007;
                    }
                }
            }
        }
        int res = 0;
        for (int i = 0; i <= n; ++i) {
            for (int j = 0; j <= limit && j <= i; ++j) {
                if (n - i <= limit) {
                    res = (res + dp[i][j]) % 1000000007;
                }
            }
        }
        return res;
    }
};

