class Solution {
public:
    int findMinimumOperations(string s1, string s2, string s3) {
        int len1 = s1.length();
        int len2 = s2.length();
        int len3 = s3.length();

        while(len1 > 0 && len2 > 0 && len3 > 0) {
            if(s1[len1-1] == s2[len2-1] && s2[len2-1] == s3[len3-1]) {
                len1--;
                len2--;
                len3--;
            } else {
                break;
            }
        }

        if(len1 == 0 || len2 == 0 || len3 == 0) {
            return -1;
        }

        return len1 + len2 + len3 - 3;
    }
};

class Solution {
public:
    bool areSimilar(vector<vector<int>>& mat, int k) {
        int m = mat.size();
        int n = mat[0].size();
        if (k % n == 0) return true;
        for (int i = 0; i < m; ++i) {
            if (i % 2 == 0 && k % n != 0) return false;
            if (i % 2 == 1 && (n - k % n) % n != 0) return false;
        }
        return true;
    }
};

