class Solution {
public:
    vector<int> numberGame(vector<int>& nums) {
        priority_queue<pair<int, int>> pq;
        for (int i = 0; i < nums.size(); i++) {
            pq.push({nums[i], i});
        }
        vector<int> res(nums.size());
        int turn = 0;
        while (!pq.empty()) {
            pair<int, int> p1 = pq.top(); pq.pop();
            pair<int, int> p2 = pq.top(); pq.pop();
            if (turn % 2 == 0) {
                res[turn] = p1.first;
                res[turn + 1] = p2.first;
            } else {
                res[turn] = p2.first;
                res[turn + 1] = p1.first;
            }
            turn += 2;
        }
        return res;
    }
};

