class Solution {
public:
    int areaOfMaxDiagonal(vector<vector<int>>& dimensions) {
        double maxDiagonal = 0;
        int maxArea = 0;
        for (auto& dimension : dimensions) {
            double diagonal = sqrt(dimension[0] * dimension[0] + dimension[1] * dimension[1]);
            int area = dimension[0] * dimension[1];
            if (diagonal > maxDiagonal || (diagonal == maxDiagonal && area > maxArea)) {
                maxDiagonal = diagonal;
                maxArea = area;
            }
        }
        return maxArea;
    }
};

class Solution {
public:
    int incremovableSubarrayCount(vector<int>& nums) {
        int n = nums.size();
        vector<int> left(n), right(n);
        left[0] = 1;
        for (int i = 1; i < n; ++i) {
            left[i] = nums[i] > nums[i - 1] ? left[i - 1] + 1 : 1;
        }
        right[n - 1] = 1;
        for (int i = n - 2; i >= 0; --i) {
            right[i] = nums[i] < nums[i + 1] ? right[i + 1] + 1 : 1;
        }
        int res = n;
        for (int i = 1; i < n - 1; ++i) {
            if (nums[i - 1] < nums[i + 1]) {
                res += min(left[i - 1], right[i + 1]);
            }
        }
        return res;
    }
};

class Solution {
public:
    int minimumCost(vector<int>& nums) {
        int n = nums.size();
        vector<vector<int>> dp(n, vector<int>(4, INT_MAX));
        dp[0][1] = nums[0];
        for(int i = 1; i < n; i++) {
            dp[i][1] = min(dp[i-1][1], nums[i]);
            for(int j = 2; j <= 3; j++) {
                if(i >= j-1) {
                    dp[i][j] = min(dp[i-1][j], dp[i-1][j-1] + nums[i]);
                }
            }
        }
        return dp[n-1][3];
    }
};

class Solution {
public:
    int minimumPushes(string word) {
        vector<int> freq(26, 0);
        for (char c : word) {
            freq[c - 'a']++;
        }
        sort(freq.begin(), freq.end(), greater<int>());
        int res = 0;
        for (int i = 0; i < 26; ++i) {
            res += freq[i] * (i % 3 + 1);
        }
        return res;
    }
};

class Solution {
public:
    int countPrefixSuffixPairs(vector<string>& words) {
        int count = 0;
        for(int i = 0; i < words.size(); i++) {
            for(int j = i + 1; j < words.size(); j++) {
                if(isPrefixAndSuffix(words[i], words[j])) {
                    count++;
                }
            }
        }
        return count;
    }

private:
    bool isPrefixAndSuffix(string& str1, string& str2) {
        if(str1.size() > str2.size()) {
            return false;
        }
        return str2.substr(0, str1.size()) == str1 && str2.substr(str2.size() - str1.size()) == str1;
    }
};

