class Solution {
public:
    int maxOperations(vector<int>& nums) {
        unordered_map<int, int> count;
        for (int num : nums) {
            count[num]++;
        }
        priority_queue<pair<int, int>> pq;
        for (auto [num, freq] : count) {
            pq.push({freq, num});
        }
        int maxOperations = 0, prevFreq = 0, prevNum = 0;
        while (!pq.empty()) {
            auto [freq, num] = pq.top(); pq.pop();
            if (prevFreq > 0) {
                prevFreq--;
                maxOperations++;
            } else if (!pq.empty()) {
                auto [nextFreq, nextNum] = pq.top(); pq.pop();
                if (nextFreq > 1) {
                    pq.push({nextFreq - 1, nextNum});
                }
                maxOperations++;
            }
            prevFreq = freq - 1;
            prevNum = num;
        }
        return maxOperations;
    }
};

class Solution {
public:
    string triangleType(vector<int>& nums) {
        sort(nums.begin(), nums.end());
        if(nums[0] + nums[1] <= nums[2]) {
            return "none";
        }
        else if(nums[0] == nums[1] && nums[1] == nums[2]) {
            return "equilateral";
        }
        else if(nums[0] == nums[1] || nums[1] == nums[2]) {
            return "isosceles";
        }
        else {
            return "scalene";
        }
    }
};

class Solution {
public:
    bool isPossibleToSplit(vector<int>& nums) {
        unordered_map<int, int> count;
        for (int num : nums) {
            count[num]++;
        }
        int maxCount = 0;
        for (auto it : count) {
            maxCount = max(maxCount, it.second);
        }
        return maxCount <= nums.size() / 2;
    }
};

class Solution {
public:
    vector<vector<int>> modifiedMatrix(vector<vector<int>>& matrix) {
        int m = matrix.size();
        int n = matrix[0].size();
        vector<int> maxInColumn(n, INT_MIN);

        // Find the maximum element in each column
        for(int j = 0; j < n; j++) {
            for(int i = 0; i < m; i++) {
                if(matrix[i][j] != -1) {
                    maxInColumn[j] = max(maxInColumn[j], matrix[i][j]);
                }
            }
        }

        // Replace -1 with the maximum element in its respective column
        for(int i = 0; i < m; i++) {
            for(int j = 0; j < n; j++) {
                if(matrix[i][j] == -1) {
                    matrix[i][j] = maxInColumn[j];
                }
            }
        }

        return matrix;
    }
};

