class Solution {
public:
    int minimumBoxes(vector<int>& apple, vector<int>& capacity) {
        sort(capacity.begin(), capacity.end(), greater<int>());
        int total_apples = accumulate(apple.begin(), apple.end(), 0);
        int total_boxes = 0;
        for (int i = 0; i < capacity.size(); i++) {
            total_apples -= capacity[i];
            total_boxes++;
            if (total_apples <= 0) {
                break;
            }
        }
        return total_boxes;
    }
};

class Solution {
public:
    vector<int> resultArray(vector<int>& nums) {
        vector<int> arr1, arr2;
        arr1.push_back(nums[0]);
        arr2.push_back(nums[1]);
        for(int i=2; i<nums.size(); i++){
            if(arr1.back() > arr2.back()){
                arr1.push_back(nums[i]);
            }else{
                arr2.push_back(nums[i]);
            }
        }
        arr1.insert(arr1.end(), arr2.begin(), arr2.end());
        return arr1;
    }
};

class Solution {
public:
    int maximumLengthSubstring(string s) {
        int n = s.size();
        vector<int> count(26, 0);
        int max_len = 0, start = 0;

        for(int end = 0; end < n; end++) {
            count[s[end] - 'a']++;

            while(count[s[end] - 'a'] > 2) {
                count[s[start] - 'a']--;
                start++;
            }

            max_len = max(max_len, end - start + 1);
        }

        return max_len;
    }
};

class Solution {
public:
    bool isSubstringPresent(string s) {
        string rev = s;
        reverse(rev.begin(), rev.end());
        unordered_set<string> substrings;
        for(int i = 0; i < s.size() - 1; i++) {
            substrings.insert(s.substr(i, 2));
        }
        for(int i = 0; i < rev.size() - 1; i++) {
            if(substrings.count(rev.substr(i, 2))) {
                return true;
            }
        }
        return false;
    }
};

class Solution {
public:
    int sumOfEncryptedInt(vector<int>& nums) {
        int sum = 0;
        for (int num : nums) {
            int maxDigit = 0;
            int temp = num;
            while (temp > 0) {
                maxDigit = max(maxDigit, temp % 10);
                temp /= 10;
            }
            int encryptedNum = 0;
            temp = num;
            while (temp > 0) {
                encryptedNum = encryptedNum * 10 + maxDigit;
                temp /= 10;
            }
            sum += encryptedNum;
        }
        return sum;
    }
};

class Solution {
public:
    int sumOfTheDigitsOfHarshadNumber(int x) {
        int sum = 0, temp = x;
        while(temp > 0) {
            sum += temp % 10;
            temp /= 10;
        }
        if(x % sum == 0) {
            return sum;
        } else {
            return -1;
        }
    }
};

class Solution {
public:
    int longestMonotonicSubarray(vector<int>& nums) {
        int n = nums.size();
        int inc = 1, dec = 1, max_len = 1;
        for(int i = 1; i < n; i++) {
            if(nums[i] > nums[i-1]) {
                inc = dec + 1;
                dec = 1;
            } else if(nums[i] < nums[i-1]) {
                dec = inc + 1;
                inc = 1;
            } else {
                inc = 1;
                dec = 1;
            }
            max_len = max(max_len, max(inc, dec));
        }
        return max_len;
    }
};

