class Solution {
public:
    int minimumSubarrayLength(vector<int>& nums, int k) {
        int n = nums.size();
        int ans = n + 1;
        for (int i = 0; i < n; ++i) {
            int sum = 0;
            for (int j = i; j < n; ++j) {
                sum |= nums[j];
                if (sum >= k) {
                    ans = min(ans, j - i + 1);
                    break;
                }
            }
        }
        return ans == n + 1 ? -1 : ans;
    }
};

class Solution {
public:
    bool isValid(string word) {
        if(word.size() < 3) return false;

        bool vowel = false, consonant = false;
        for(char c : word) {
            if((c >= 'a' && c <= 'z') || (c >= 'A' && c <= 'Z')) {
                if(c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u' || 
                   c == 'A' || c == 'E' || c == 'I' || c == 'O' || c == 'U') {
                    vowel = true;
                } else {
                    consonant = true;
                }
            } else if(c >= '0' && c <= '9') {
                continue;
            } else {
                return false;
            }
        }

        return vowel && consonant;
    }
};

