class Solution {
public:
    bool canMakeSquare(vector<vector<char>>& grid) {
        for (int i = 0; i < 2; ++i) {
            for (int j = 0; j < 2; ++j) {
                int white = 0;
                for (int x = i; x < i + 2; ++x) {
                    for (int y = j; y < j + 2; ++y) {
                        if (grid[x][y] == 'W') {
                            ++white;
                        }
                    }
                }
                if (white != 1 && white != 3) {
                    return true;
                }
            }
        }
        return false;
    }
};

class Solution {
public:
    int numberOfSpecialChars(string word) {
        vector<int> lower(26, 0), upper(26, 0);
        for (char c : word) {
            if (islower(c)) lower[c - 'a']++;
            else upper[c - 'A']++;
        }
        int count = 0;
        for (int i = 0; i < 26; i++) {
            if (lower[i] > 0 && upper[i] > 0) count++;
        }
        return count;
    }
};

class Solution {
public:
    int findPermutationDifference(string s, string t) {
        int diff = 0;
        for(int i = 0; i < s.size(); i++) {
            for(int j = 0; j < t.size(); j++) {
                if(s[i] == t[j]) {
                    diff += abs(i - j);
                    break;
                }
            }
        }
        return diff;
    }
};

class Solution {
public:
    bool satisfiesConditions(vector<vector<int>>& grid) {
        int m = grid.size();
        int n = grid[0].size();

        for(int i = 0; i < m; i++) {
            for(int j = 0; j < n; j++) {
                if(i < m - 1 && grid[i][j] != grid[i + 1][j]) {
                    return false;
                }
                if(j < n - 1 && grid[i][j] == grid[i][j + 1]) {
                    return false;
                }
            }
        }
        return true;
    }
};

