class Solution {
public:
    int minimumChairs(string s) {
        int chairs = 0, people = 0;
        for (char c : s) {
            if (c == 'E') {
                people++;
                if (people > chairs) {
                    chairs = people;
                }
            } else if (c == 'L') {
                people--;
            }
        }
        return chairs;
    }
};

class Solution {
public:
    int duplicateNumbersXOR(vector<int>& nums) {
        unordered_map<int, int> count;
        int result = 0;
        for (int num : nums) {
            count[num]++;
        }
        for (auto& pair : count) {
            if (pair.second == 2) {
                result ^= pair.first;
            }
        }
        return result;
    }
};

