class Solution {
public:
    string clearDigits(string s) {
        stack<char> st;
        for (char c : s) {
            if (isdigit(c)) {
                if (!st.empty()) {
                    st.pop();
                }
            } else {
                st.push(c);
            }
        }
        string res = "";
        while (!st.empty()) {
            res = st.top() + res;
            st.pop();
        }
        return res;
    }
};

class Solution {
public:
    int numberOfChild(int n, int k) {
        int pos = 0;
        int direction = 1;
        for(int i = 0; i < k; i++){
            pos += direction;
            if(pos == 0 || pos == n - 1){
                direction *= -1;
            }
        }
        return pos;
    }
};

