class Solution {
public:
    int maxHeightOfTriangle(int red, int blue) {
        int l = 0, r = 200;
        while (l < r) {
            int mid = (l + r + 1) / 2;
            if (mid * (mid + 1) / 2 <= red + blue && mid * (mid + 1) / 4 <= min(red, blue)) {
                l = mid;
            } else {
                r = mid - 1;
            }
        }
        return l;
    }
};

class Solution {
public:
    double minimumAverage(vector<int>& nums) {
        priority_queue<double, vector<double>, greater<double>> minHeap;
        priority_queue<double> maxHeap;
        for (int num : nums) {
            minHeap.push(num);
            maxHeap.push(num);
        }
        vector<double> averages;
        while (!minHeap.empty()) {
            double minElement = minHeap.top();
            minHeap.pop();
            double maxElement = maxHeap.top();
            maxHeap.pop();
            while (!minHeap.empty() && minHeap.top() == minElement) {
                minHeap.pop();
            }
            while (!maxHeap.empty() && maxHeap.top() == maxElement) {
                maxHeap.pop();
            }
            averages.push_back((minElement + maxElement) / 2.0);
        }
        return *min_element(averages.begin(), averages.end());
    }
};

class Solution {
public:
    int minimumOperations(vector<int>& nums) {
        vector<int> cnt(3, 0);
        for (int num : nums) {
            cnt[num % 3]++;
        }
        int res = 0;
        while (cnt[1] > 0 && cnt[2] > 0) {
            cnt[1]--;
            cnt[2]--;
            res += 2;
        }
        if (cnt[1] > 0) {
            res += cnt[1] / 3 * 2;
            if (cnt[1] % 3 != 0) {
                res += 2;
            }
        }
        if (cnt[2] > 0) {
            res += cnt[2] / 3 * 2;
            if (cnt[2] % 3 != 0) {
                res += 2;
            }
        }
        return res;
    }
};

class Solution {
public:
    string getSmallestString(string s) {
        int n = s.size();
        for(int i = 0; i < n - 1; i++) {
            if(s[i] % 2 == s[i + 1] % 2 && s[i] > s[i + 1]) {
                swap(s[i], s[i + 1]);
                break;
            }
        }
        return s;
    }
};

class Solution {
public:
    int minChanges(int n, int k) {
        int changes = 0;
        for (int i = 0; i < 31; ++i) {
            bool bit_n = n & (1 << i);
            bool bit_k = k & (1 << i);
            if (bit_n && !bit_k) {
                ++changes;
            } else if (!bit_n && bit_k) {
                return -1;
            }
        }
        return changes;
    }
};

