class NeighborSum {
public:
    vector<vector<int>> grid;
    unordered_map<int, pair<int, int>> pos;
    int n;

    NeighborSum(vector<vector<int>>& grid) {
        this->grid = grid;
        this->n = grid.size();
        for(int i = 0; i < n; i++) {
            for(int j = 0; j < n; j++) {
                pos[grid[i][j]] = {i, j};
            }
        }
    }

    int adjacentSum(int value) {
        int sum = 0;
        int x = pos[value].first;
        int y = pos[value].second;
        if(x > 0) sum += grid[x-1][y];
        if(x < n-1) sum += grid[x+1][y];
        if(y > 0) sum += grid[x][y-1];
        if(y < n-1) sum += grid[x][y+1];
        return sum;
    }

    int diagonalSum(int value) {
        int sum = 0;
        int x = pos[value].first;
        int y = pos[value].second;
        if(x > 0 && y > 0) sum += grid[x-1][y-1];
        if(x > 0 && y < n-1) sum += grid[x-1][y+1];
        if(x < n-1 && y > 0) sum += grid[x+1][y-1];
        if(x < n-1 && y < n-1) sum += grid[x+1][y+1];
        return sum;
    }
};

class Solution {
public:
    int winningPlayerCount(int n, vector<vector<int>>& pick) {
        unordered_map<int, unordered_map<int, int>> playerColorCount;
        for (auto& p : pick) {
            playerColorCount[p[0]][p[1]]++;
        }
        int winners = 0;
        for (int i = 0; i < n; i++) {
            for (auto& colorCount : playerColorCount[i]) {
                if (colorCount.second > i) {
                    winners++;
                    break;
                }
            }
        }
        return winners;
    }
};

class Solution {
public:
    int finalPositionOfSnake(int n, vector<string>& commands) {
        int x = 0, y = 0;
        for (string command : commands) {
            if (command == "UP") {
                x--;
            } else if (command == "DOWN") {
                x++;
            } else if (command == "LEFT") {
                y--;
            } else if (command == "RIGHT") {
                y++;
            }
        }
        return x * n + y;
    }
};

class Solution {
public:
    int countKConstraintSubstrings(string s, int k) {
        int n = s.size();
        int count = 0;
        for (int i = 0; i < n; ++i) {
            int zeros = 0, ones = 0;
            for (int j = i; j < n; ++j) {
                if (s[j] == '0') ++zeros;
                else ++ones;
                if (zeros > k || ones > k) break;
                ++count;
            }
        }
        return count;
    }
};
